import React from 'react';
import './FAQ.css'; // Import your CSS file


function FAQ() {
  return (
    <div className="container">
      <h1>Frequently Asked Questions</h1>
      <h2>When/where is the wedding?</h2>
      <p>Our wedding will take place at Sarma, a restaurant in Somerville, MA (249 Pearl St, Somerville, MA 02145). The festivities will start promptly (well, promptly-ish) at 5 PM.</p>
      {/* Add your FAQ content here */}
    </div>
  );
}

export default FAQ;
